import { forwardRef } from "react";
import "./Input.css"
const Input=React.forwardRef((props)=>{
    return(
        <div className="input">
            <label htmlFor={props.input.id}>{props.label}</label>
            <input ref={props.ref} {...props.input}  />
        </div>
    )
})
export default Input;
